const _hoisted_1 = /* @__PURE__ */ createStaticVNode('<h1 id="laboratory-work" tabindex="-1"><a class="header-anchor" href="#laboratory-work" aria-hidden="true">#</a> Laboratory Work</h1><p>On this page you find information about the examination test <code>Laboratory work</code>.</p><h2 id="number-of-credits" tabindex="-1"><a class="header-anchor" href="#number-of-credits" aria-hidden="true">#</a> Number of credits</h2><p>The <code>Laboratory work</code> is worth 4.5 credits, but you probably need to spend more time than this on completing the labs, because working on the labs will also teach you the things you need to know for the written examination. After you have successfully completed all labs you should not need to study much for the written examination.</p><h2 id="description" tabindex="-1"><a class="header-anchor" href="#description" aria-hidden="true">#</a> Description</h2><p>The <code>Laboratory work</code> should be carried out individually. It consists of 6 different parts called &quot;labs&quot; (Lab 1, Lab 2, ..., Lab 6). You will pass the laboratory work (get grade <code>G</code>) when you have completed all 6 labs.</p><p>Each lab contains a set of programming problems you need to solve. Each solution should be implemented in Python 3, and before you&#39;re approved on each lab you also need to orally present your solution and implementation to a teacher at a lab session. You are expected to be able to explain how your solutions (algorithms) work, and how each line of Python code you have written works. The teacher can&#39;t approve you on the lab if you can&#39;t do that.</p><p>You are expected to complete one lab each week. No deadlines exist (e.g. presenting Lab 1 four weeks after the course has started is OK), but since you need to present your work at a lab session, the last lab session in the course will in practice function as a deadline.</p><h2 id="re-examination" tabindex="-1"><a class="header-anchor" href="#re-examination" aria-hidden="true">#</a> Re-examination</h2><p>Re-examination of the <code>Laboratory work</code> will be offered at the re-examination periods in February and in August (the same re-examination periods as for the written examination). A special lab session will be booked for these re-examination periods. If you need to know when the lab session will take place in advance, email the course coordinator.</p><h2 id="individual-work" tabindex="-1"><a class="header-anchor" href="#individual-work" aria-hidden="true">#</a> Individual work</h2><p>The laboratory work is individual work.</p><p><strong>It is OK to help each other.</strong> Examples of that:</p><ul><li>Help your friend to debug his code</li><li>Explain to your friend why his code doesn&#39;t work the way he thinks it works</li><li>To some degree help your friend to solve the problem, such as with pen and paper show an algorithm that solves the problem</li><li>Compare and discuss different solutions to the lab problems with your friend to figure out which solution is the best one after both of you have completed a lab</li></ul><p><strong>It is NOT OK to cooperate in any way.</strong> Examples of that:</p><ul><li>Sit at the same computer and write code together with your friend</li><li>Sit at different computers and discuss and write the same code as your friend</li><li>Give code to/receive code from your friend</li></ul><p>You must write your own code! If you are unsure about what counts as <em>helping</em> and what counts as <em>cheating</em>, then simply work alone and ask only the teacher at the lab sessions for help.</p><div class="custom-container tip"><p class="custom-container-title">Too hard?</p><p>If you think the Laboratory Work problems are too hard to solve, sit together with a friend and try to solve the Exercise problems together. The Exercises is a <em>learning activity</em>, so feel free to co-operate as much as you want on those to learn. The Laboratory Work is an <em>examination test</em>, so most of the work must be done by each individual so we can be sure that each individual have learned the intended learning outcomes.</p></div><h2 id="lab-1-input-output-loops" tabindex="-1"><a class="header-anchor" href="#lab-1-input-output-loops" aria-hidden="true">#</a> Lab 1 - Input, output &amp; loops</h2><div class="custom-container warning"><p class="custom-container-title">Note!</p><p>Before you attempt solving the programming problems in Lab 1 you are strongly recommended to solve the programming problems in Exercise 0 and Exercise 1 and watch the recorded lectures mentioned there.</p></div><h3 id="problem-1-1-computing-the-sum-of-3-numbers" tabindex="-1"><a class="header-anchor" href="#problem-1-1-computing-the-sum-of-3-numbers" aria-hidden="true">#</a> Problem 1.1: Computing the sum of 3 numbers</h3><p>Create a program that asks the user to enter a number three times and which then computes and prints the sum of those numbers. Do not use any loop.</p><h3 id="problem-1-2-computing-the-sum-of-5-numbers" tabindex="-1"><a class="header-anchor" href="#problem-1-2-computing-the-sum-of-5-numbers" aria-hidden="true">#</a> Problem 1.2: Computing the sum of 5 numbers</h3><p>Create a program that asks the user to enter a number 5 times and which then computes and prints the sum of those numbers. Make use of a loop instead of having multiple copies of the same statements.</p><h3 id="problem-1-3-computing-the-average-of-multiple-numbers" tabindex="-1"><a class="header-anchor" href="#problem-1-3-computing-the-average-of-multiple-numbers" aria-hidden="true">#</a> Problem 1.3: Computing the average of multiple numbers</h3><p>Create a program that first asks the user how many numbers she would like to enter. The program should then ask the user to enter a number that many times, and then should the program print the average value of those numbers. The average value is simply the sum of the numbers divided by the number of numbers.</p><h3 id="problem-1-4-displaying-a-multiplication-table" tabindex="-1"><a class="header-anchor" href="#problem-1-4-displaying-a-multiplication-table" aria-hidden="true">#</a> Problem 1.4: Displaying a multiplication table</h3>', 27);
